import React, { Component } from 'react';
export default class ContactUs extends Component {
  render() {
    let resumeData = this.props.resumeData;
    return (
      <section id="contact">
          <div className="row section-head">
            <div className="ten columns">
              <form id="form" className="topBefore" action="" method="post">
                <input id="name" type="text" required name="name" placeholder="Name" />
                <input id="email" type="email" required name="email" placeholder="E-Mail" />
                <input id="subject" type="subject" required name="subject" placeholder="Subject" />
                <textarea id="message" type="message" required name="message" placeholder="Message"></textarea>
                <input id="submit" type="submit" disabled value="Submit" />
              </form>
            </div>
          </div>
          <div className="row">
            <aside className="eigth columns footer-widgets">
              <div className="widget">
                <h4>Linked in :
                  {resumeData.linkedinId}
                </h4>
              </div>
            </aside>
          </div>
        </section>
        );
  }
}
